        'sk' => '{"_vesta_shared_places_":"Modul poskytuj\u00faci podporu pre zdie\u013ean\u00e9 miesta.","_webtrees-primer-theme_":"Mot\u00edv \u2014 Primer","_webtrees-statistics_":"R\u00f4zne \u0161tatistick\u00e9 sch\u00e9my.","_vesta_classic_look_and_feel_":"Modul upravuj\u00faci v\u0161etky mot\u00edvy a ostatn\u00e9 vlastnosti. Poskytuje vzh\u013ead a pou\u017eitie, ktor\u00e9 s\u00fa podobnej\u0161ie verzii webtrees 1.x.","_vesta_clippings_cart_":"Vyberte z\u00e1znamy z v\u00e1\u0161ho rodokme\u0148a a ulo\u017ete ich ako GEDCOM s\u00fabor. N\u00e1hrada za p\u00f4vodn\u00fd modul \u201eSchr\u00e1nka v\u00fdstri\u017ekov\u201c.","_vesta_extended_relationships_":"Modul na v\u00fdpo\u010det rodinn\u00fdch a in\u00fdch vz\u0165ahov. M\u00f4\u017ee sa pou\u017ei\u0165 ako n\u00e1hrada za sch\u00e9mu \u201eVz\u0165ahy\u201c. Jeho s\u00fa\u010das\u0165ou je aj roz\u0161\u00edren\u00fd blok \u201eKto je prihl\u00e1sen\u00fd\u201c.","_vesta_location_data_":"Modul poskytuj\u00faci webtrees \u00fadaje (neulo\u017een\u00e9 v GEDCOM) o polohe in\u00fdm modulom.","_jp-theme-colors_":"Mot\u00edv \u2014 Jp-barvy","_webtrees-lantmateriet_":"Vytvori\u0165 mapy pou\u017eit\u00edm <a href=\"https:\/\/www.lantmateriet.se\" dir=\"ltr\">www.lantmateriet.se<\/a>.","_huhwt-xtv_":"Z\u00e1lo\u017eka obsahuj\u00faca interakt\u00edvny strom, ktor\u00fd zobrazuje v\u0161etk\u00fdch predkov a potomkov osoby.","_vesta_gov4webtrees_":"Modul integruj\u00faci z datab\u00e1zy GOV (historick\u00e9 n\u00e1zvy obc\u00ed a miest).","_jc-theme-justlight_":"Mot\u00edv \u2014 JustLight","_vesta_personal_facts_":"Z\u00e1lo\u017eka zobrazuj\u00faca fakty a udalosti danej osoby. N\u00e1hrada za p\u00f4vodn\u00fd modul \u201eFakty a udalosti\u201c.  Roz\u0161\u00edri\u0165 fakty a udalosti aj na str\u00e1nke rodiny. Poskytn\u00fa\u0165 aj dodato\u010dn\u00e9 odkazy na mapy.","_vesta_research_suggestions_":"Modul, ktor\u00fd poskytuje n\u00e1vrhy pre \u010fal\u0161\u00ed v\u00fdskum na z\u00e1klade existu