        'sv' => '{"_vesta_shared_places_":"En modul som ger st\u00f6d f\u00f6r delade platser.","_webtrees-primer-theme_":"Tema \u2014 Primer","_webtrees-statistics_":"Olika statistkdiagram.","_vesta_clippings_cart_":"V\u00e4lj poster fr\u00e5n ditt sl\u00e4kttr\u00e4d och spara dem som en GEDCOM-fil. Ers\u00e4ttning f\u00f6r den ursprungliga modulen \"Urklippsvagn\".","_vesta_extended_relationships_":"En modul som tillhandah\u00e5ller olika algoritmer som anv\u00e4nds f\u00f6r att best\u00e4mma relationer eller sl\u00e4ktskap. Inkluderar ett diagram som visar relationer mellan tv\u00e5 individer, som en ers\u00e4ttning f\u00f6r original \'Relationer\' modulen. Also includes an extended \'Vem \u00e4r online\' block.","_vytux_cousins_":"En flik som visar en persons kusiner.","_vesta_location_data_":"En modul som tillhandah\u00e5ller (icke-GEDCOM-baserade) webtrees platsdata till andra moduler.","_jp-theme-colors_":"Tema \u2014 Jp-barvy","_jc-fancy-research-links_":"Ett sidebar verktyg med snabba l\u00e4nkar till popul\u00e4ra forskning webbplatser.","_news-menu_":"L\u00e4gg till en extra post i huvudmenyn som en l\u00e4nk till webtrees nyheter.","_telegram_":"Skickar Telegram-aviseringar om familjeh\u00e4ndelser, som f\u00f6delsedagar och \u00e5rsdagar.","_webtrees-descendants-chart_":"En \u00f6versikt \u00f6ver en persons \u00e4ttlingar.","_webtrees-lantmateriet_":"Skapa kartor med <a href=\"https:\/\/www.lantmateriet.se\" dir=\"ltr\">www.lantmateriet.se<\/a>.","_huhwt-xtv_":"Ett interaktivt tr\u00e4d, visande en persons alla f\u00f6rf\u00e4der och efterkommande.","_jc-fancy-imagebar_":"Ett bildf\u00e4lt med sm\u00e5 foton placerat mellan sidhuvud och inneh\u00e5ll.","_jc-theme-justlight_":"Tema \u2014 JustLight","_vesta_personal_facts_":"En flik som visar fakta och h\u00e4ndelser till en person. Replacement for the original \'Facts and events\' module.  Also extends facts and events on the family page. Also provides additional map links.","_webtrees-fan-chart_":"Et