        'vi' => '{"_vesta_shared_places_":"M\u1ed9t m\u00f4-\u0111un cung c\u1ea5p h\u1ed7 tr\u1ee3 cho c\u00e1c \u0111\u1ecba \u0111i\u1ec3m \u0111\u01b0\u1ee3c chia s\u1ebb.","_webtrees-primer-theme_":"Ch\u1ee7 \u0111\u1ec1 \u2014 Primer","_webtrees-statistics_":"Bi\u1ec3u \u0111\u1ed3 th\u1ed1ng k\u00ea kh\u00e1c nhau.","_vesta_classic_look_and_feel_":"M\u1ed9t m\u00f4-\u0111un \u0111i\u1ec1u ch\u1ec9nh t\u1ea5t c\u1ea3 c\u00e1c ch\u1ee7 \u0111\u1ec1 v\u00e0 c\u00e1c t\u00ednh n\u0103ng kh\u00e1c, cung c\u1ea5p giao di\u1ec7n v\u00e0 c\u1ea3m gi\u00e1c g\u1ea7n g\u0169i h\u01a1n v\u1edbi phi\u00ean b\u1ea3n webtrees 1.x.","_vesta_clippings_cart_":"Ch\u1ecdn file t\u1eeb c\u00e2y gia \u0111\u00ecnh v\u00e0 l\u01b0u ch\u00fang th\u00e0nh file GEDCOM. Thay th\u1ebf cho m\u00f4-\u0111un \'Clippings Cart\' ban \u0111\u1ea7u.","_vesta_extended_relationships_":"M\u1ed9t m\u00f4-\u0111un cung c\u1ea5p c\u00e1c thu\u1eadt to\u00e1n kh\u00e1c nhau \u0111\u01b0\u1ee3c s\u1eed d\u1ee5ng \u0111\u1ec3 x\u00e1c \u0111\u1ecbnh c\u00e1c m\u1ed1i quan h\u1ec7. Bao g\u1ed3m m\u1ed9t bi\u1ec3u \u0111\u1ed3 hi\u1ec3n th\u1ecb m\u1ed1i quan h\u1ec7 gi\u1eefa hai c\u00e1 nh\u00e2n, thay th\u1ebf cho m\u00f4-\u0111un \'M\u1ed1i quan h\u1ec7\' ban \u0111\u1ea7u. C\u0169ng bao g\u1ed3m m\u1ed9t kh\u1ed1i \'Ai \u0111ang online\' m\u1edf r\u1ed9ng.","_vesta_location_data_":"M\u1ed9t m\u00f4-\u0111un cung c\u1ea5p d\u1eef li\u1ec7u v\u1ecb tr\u00ed (kh\u00f4ng d\u1ef1a tr\u00ean GEDCOM) cho c\u00e1c m\u00f4-\u0111un kh\u00e1c.","_jp-theme-colors_":"Ch\u1ee7 \u0111\u1ec1 \u2014 Jp-barvy","_webtrees-descendants-chart_":"T\u1ed5ng quan v\u1ec1 con ch\u00e1u c\u1ee7a m\u1ed9t c\u00e1 nh\u00e2n.","_huhwt-xtv_":"M\u1ed9t c\u00e2y gia ph\u1ea3 t\u01b0\u01a1ng t\u00e1c hi\u1ec3n th\u1ecb t\u1ea5t c\u1ea3 t\u1ed5 ti\u00ean v\u00e0 con ch\u00e1u c\u1ee7a m\u1ed9t ng\u01b0\u1eddi.","_vesta_gov4webtrees_":"M\u1ed9t m\u00f4-\u0111un t\u00edch h\u1ee3p d\u1eef li\u1ec7u GOV (c\u00f4ng b\u00e1o l\u1ecbch s\u1eed).","_jc-theme-justlight_":"Ch\u1ee7 \u0111\u1ec1 \u2014 JustLight","_vesta_personal_facts_":"M\u1ed9t th\u1ebb hi\u1ec3n th\u1ecb s\u1ef1 ki\u1ec7n v\u00e0 s\u1ed1 li\u1ec7u c\u1ee7a m\u1ed9t c\u00e1 nh\u00e2n. Thay th\u1ebf cho m\u00f4-\u0111un \'S\u1ef1 ki\u1ec7n v\u00e0 s\u1ed1 li\u1ec7u\' ban \u0111\u1ea7u.  Trang n\u00e0y c\u00f2n b\u1ed5 sung th\u00eam th\u00f4ng tin v\u00e0 s\u1ef1 ki\u1ec7n v\u1ec1 gia \u0111\u00ecnh. Cung c\u1ea5p th\u00eam c\u00e1c li\u00ean k\u1ebft b\u1ea3n \u0111\u1ed3.","_vesta_research_suggestions_":"M\u1ed9t m\u00f4-\u0111un cung c\u1ea5p c\u00e1c g\u1ee3i \u00fd cho nghi\u00ean c\u1ee9u b\u1ed5 sung, d\u1ef1a tr\u00ean c\u00e1c ngu\u1ed3n c\u00f3 s\u1eb5n.","_webtrees-fan-chart_":"Bi\u1ec3u \u0111\u1ed3 c\u00e1 nh\u00e2n T\u1ed5 ti\u00ean","_vesta_common_":"M\u1ed9t m\u00f4-\u0111un cung c\u1ea5p c\u00e1c l\u1edbp ph\u1ed5 bi\u1ebfn v\u00e0 b\u1ea3n d\u1ecbch cho c\u00e1c m\u00f4-\u0111un t\u00f9y ch\u1ec9nh kh\u00e1c c\u1ee7a \'Vesta\'. H\u00e3y \u0111\u1ea3m b\u1ea3o k\u00edch ho\u1ea1t m\u00f4-\u0111un n\u00e0y n\u1ebfu b\u1ea5t k\u1ef3 m\u00f4-\u0111un Vesta n\u00e0o kh\u00e1c \u0111ang \u0111\u01b0\u1ee3c k\u00edch ho\u1ea1t.","_myartjaub_ruraltheme_":"Ch\u1ee7 \u0111\u1ec1 \u2014 Rural","_webtrees-pedigree-chart_":"Bi\u1ec3u \u0111\u1ed3 ph\u1ea3 h\u1ec7 c\u1ee7a t\u1ed5 ti\u00ean c\u1ee7a m\u1ed9t c\u00e1 nh\u00e2n.","_vesta_relatives_":"M\u1ed9t th\u1ebb hi\u1ec3n th\u1ecb b\u00e0 con g\u1ea7n c\u1ee7a m\u1ed9t ng\u01b0\u1eddi. Thay th\u1ebf cho m\u00f4-\u0111un \'Gia \u0111\u00ecnh\' ban \u0111\u1ea7u.","_vesta_places_and_pedigree_map_":"H\u1ec7 th\u1ed1ng ph\u00e2n c\u1ea5p \u0110\u1ecba \u0111i\u1ec3m. \u0110\u1ed3ng th\u1eddi hi\u1ec3n th\u1ecb v\u1ecb tr\u00ed c\u1ee7a c\u00e1c s\u1ef1 ki\u1ec7n v\u00e0 n\u01a1i sinh c\u1ee7a t\u1ed5 ti\u00ean tr\u00ean b\u1ea3n \u0111\u1ed3. Thay th\u1ebf cho c\u00e1c m\u00f4-\u0111un \'Ph\u00e2n c\u1ea5p \u0111\u1ecba \u0111i\u1ec3m\', \'\u0110\u1ecba \u0111i\u1ec3m\' v\u00e0 \