        'tr' => '{"_vesta_shared_places_":"Payla\u015f\u0131lan yerler i\u00e7in destek sa\u011flayan bir mod\u00fcl.","_webtrees-primer-theme_":"Tema \u2014 Primer","_webtrees-statistics_":"\u00c7e\u015fitli istatistik grafikleri.","_vesta_classic_look_and_feel_":"T\u00fcm temalar\u0131 ve di\u011fer \u00f6zellikleri ayarlayan, webtrees 1.x s\u00fcr\u00fcm\u00fcne daha yak\u0131n bir g\u00f6r\u00fcn\u00fcm ve his sa\u011flayan bir mod\u00fcl.","_vesta_clippings_cart_":"Aile a\u011fac\u0131n\u0131zdan kay\u0131tlar\u0131 se\u00e7in ve bunlar\u0131 bir GEDCOM dosyas\u0131 olarak kaydedin. Orijinal \'Kup\u00fcrler Sepeti\' mod\u00fcl\u00fcn\u00fcn de\u011fi\u015ftirilmesi.","_vesta_extended_relationships_":"\u0130li\u015fkileri belirlemek i\u00e7in kullan\u0131lan \u00e7e\u015fitli algoritmalar sa\u011flayan bir mod\u00fcl. Orijinal \'\u0130li\u015fkiler\' mod\u00fcl\u00fcn\u00fcn yerine iki ki\u015fi aras\u0131ndaki ili\u015fkileri g\u00f6steren bir grafik i\u00e7erir. Ayr\u0131ca geni\u015fletilmi\u015f bir \'Kim \u00e7evrimi\u00e7i\' blo\u011fu i\u00e7erir.","_vesta_location_data_":"Di\u011fer mod\u00fcllere (GEDCOM tabanl\u0131 olmayan) webtrees konum verileri sa\u011flayan bir mod\u00fcl.","_jp-theme-colors_":"Tema \u2014 Jp-barvy","_webtrees-lantmateriet_":"<a href=\"https:\/\/www.lantmateriet.se\" dir=\"ltr\">www.lantmateriet.se<\/a> kullanarak haritalar olu\u015fturun.","_huhwt-xtv_":"Bir bireyin t\u00fcm atalar\u0131n\u0131 ve nesillerini g\u00f6steren etkile\u015fimli bir a\u011fa\u00e7.","_vesta_gov4webtrees_":"GOV (tarihi gazete) verilerini entegre eden bir mod\u00fcl.","_jc-theme-justlight_":"Tema \u2014 JustLight","_vesta_personal_facts_":"Bir bireyin ger\u00e7eklerini ve olaylar\u0131n\u0131 g\u00f6steren bir sekme. Orijinal \'Ger\u00e7ekler ve olaylar\' mod\u00fcl\u00fcn\u00fcn de\u011fi\u015ftirilmesi.  Ayr\u0131ca aile sayfas\u0131ndaki bilgi ve olaylar\u0131 da geni\u015fletir. Ayr\u0131ca ek harita ba\u011flant\u0131lar\u0131 da sa\u011flar.","_ves